    true,nt"url": null,nt"notes": "The USAID Jordan Local Enterprise Support
    Project (LENS) conducted a survey of MSEs in 2014-2015 to better understand Jordanian
    enterprises and to assess the major barriers and opportunities for growth. The study
    covers general demographics, workforce trends, firm performance, access to finance,
    processes and networks, and the impact of the Syrian refugee crisis.  The survey
    consists of 86 questions in a double sampling design with stratification. The data
    gathers representative information for all MSEs operating in the governorates of
    Amman (excluding the Greater AmmanMunicipality), Zarqa, Irbid, Karak, Tafilah, and
    Aqaba (excluding the ASEZA free zone). Although the study is not intended to be
    national in scope, the target population of the six areas collectively capture 60%
    of the kingdomu2019s population.",nt"license_title": "Other License Specified",nt"extras":
